import React from "react";
import "./Support.css";
import { NavLink } from "react-router-dom";
import Ticket from "../Ticket/Ticket";

const Support = (props) =>{
    return (
        <div className="Support">
         <div className="support-wrapper">
            <div className="tickets">
                <Ticket ticketid="1" ticketheme="Не пришёл товар" />
                <Ticket ticketid="2" ticketheme="Долго грузится карточка товара" />
                <NavLink to="/support/3">Название тикета 3</NavLink>
                <NavLink to="/support/4">Название тикета 4</NavLink>
                <NavLink to="/support/5">Название тикета 5</NavLink>
                <NavLink to="/support/6">Название тикета 6</NavLink>
                <NavLink to="/support/7">Название тикета 7</NavLink>
            </div>
            <div className="chat-container">
            <div className="messages">
                <div className="message">Здравствуйте</div>
                <div className="message">Привет!</div>
                <div className="message">В чём проблема?</div>
                <div className="message">Ни в  чём, просто написал</div>
            </div>
            </div>
         </div>
        </div>
        
    );
}

export default Support;
